import React from "react";

export const Welcome = props => (
    <section id="section-1" className="row vh-100 align-items-center">
      <div className="col">
        <h1>Hello, I'm Mateo, a Full Stack Web Developer.</h1>
        <div className="mt-5">
          {
            props.links.map(
              (b, i) => 
              <a className="contact-links" href={b.link} target="_blank" key={i}>
                <i className= {b.icon + " fs-1 mx-3"}/>
              </a>
            )
              }
        </div>
      </div>
    </section>
)
